import React from 'react';
import dylan from '../../Images/Dylan.png'

const Intro = () => {
    return(
        <div className='intro'>
            <div syle={{width: '35vw', border: 'black solid 2px'}}><img className='photo' src={dylan}/></div>
            <section>
                <p syle={{width: '65vw'}}>Educated entry level full-stack software developer seeking to gain employment as a Front-end React developer or Back-end Node developer where I can provide immediate value to a team and grow as an employee </p>
            </section>
        </div>
    )
}

export default Intro;
